<script>
export default {
  name: "index",
  layout: 'default',
  data: () => ({
    zoom : 0.424408,
    left : -600,
    top: -130
  }),
  mounted() {
    document.addEventListener("wheel", this.wheel);
  },
  computed:{
    styleMap(){
      return "width: 3000px; height: 3500px;transform-origin: 0px 0px 0px; transform: matrix("+this.zoom+", 0, 0, "+this.zoom+", "+this.left+", "+this.top+"); will-change: transform;";
    }
  },
  methods:{
    wheel(e){
      if(e.deltaY > 0){
        this.zoom = this.zoom - 0.030
        this.left = this.left + 50
        this.top = this.top + 50
      }else{
        this.zoom = this.zoom + 0.030
        this.left = this.left - 50
        this.top = this.top - 50
      }
    }
  }
}
</script>

